import React from "react";
import Sdata from "./Sdata"
import Card from "./Cards";


const myfavS = "Amazon";
const FavS = () =>{
if(myfavS == "Netflix"){
        return( <Card key = {Sdata[1].id}
                imgSrc={Sdata[1].img} 
                title={Sdata[1].title}
                sname={Sdata[1].name} 
                link={Sdata[1].link}/>
            );
}else {
        return( <Card key = {Sdata[4].id}
                imgSrc={Sdata[4].img} 
                title={Sdata[4].title}
                sname={Sdata[4].name} 
                link={Sdata[4].link}/>
            );
}
       
}



const App = () =>{
                    return(
                                <>
                                <h2>List of Top 5 Netflix web Series</h2>
                                 <FavS/> 
                                </>
                    );
        }


        export default App;
